import React from "react";
import { useParams } from "react-router-dom";


function Resume() {
    let {profile} = useParams()
    return (
        <div>
            <div>
                Hi
                <img style={{width: '80%', height: '80%'}} src={`/data/${profile}/${profile}.jpg`}/>
            </div>
        </div>
    );
};

export default Resume;
